    //         "lastMkt": "string",
    //         "lastLiquidityInd": "string",
    //         "simpleOrderQty": 0,
    //         "orderQty": 0,
    //         "price": 0,
    //         "displayQty": 0,
    //         "stopPx": 0,
    //         "pegOffsetValue": 0,
    //         "pegPriceType": "string",
    //         "currency": "string",
    //         "settlCurrency": "string",
    //         "execType": "string",
    //         "ordType": "string",
    //         "timeInForce": "string",
    //         "execInst": "string",
    //         "contingencyType": "string",
    //         "exDestination": "string",
    //         "ordStatus": "string",
    //         "triggered": "string",
    //         "workingIndicator": true,
    //         "ordRejReason": "string",
    //         "simpleLeavesQty": 0,
    //         "leavesQty": 0,
    //         "simpleCumQty": 0,
    //         "cumQty": 0,
    //         "avgPx": 0,
    //         "commission": 0,
    //         "tradePublishIndicator": "string",
    //         "multiLegReportingType": "string",
    //         "text": "string",
    //         "trdMatchID": "string",
    //         "execCost": 0,
    //         "execComm": 0,
    //         "homeNotional": 0,
    //         "foreignNotional": 0,
    //         "transactTime": "2019-03-05T12:47:02.762Z",
    //         "timestamp": "2019-03-05T12:47:02.762Z"
    //     }
    //
